import React from "react";
import ReorderIcon from "@mui/icons-material/Reorder";
import { Icon, IconButton } from "@material-ui/core";
import SearchIcon from "@mui/icons-material/Search";
import KeyboardArrowDownIcon from "@mui/icons-material/KeyboardArrowDown";
import HelpOutlineIcon from "@mui/icons-material/HelpOutline";
import SettingsIcon from "@mui/icons-material/Settings";
import AppsIcon from "@mui/icons-material/Apps";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";

import "../LeftRight/Header.css";
const Header = () => {
  return (
    <div className="header">
      <div className="header_left">
        <IconButton>
          {" "}
          <ReorderIcon></ReorderIcon>
        </IconButton>
        <img
          src="https://ssl.gstatic.com/ui/v1/icons/mail/rfr/logo_gmail_lockup_default_1x_r5.png"
          alt="logo"
        ></img>
      </div>
      <div className="header_mid">
        <div className="search_mail">
          <IconButton>
            <SearchIcon></SearchIcon>
          </IconButton>

          <input type="text" placeholder="Search Mail..."></input>
          <IconButton>
            {" "}
            <KeyboardArrowDownIcon></KeyboardArrowDownIcon>
          </IconButton>
        </div>
      </div>

      <div className="header_right">
        <div className="right_space">
          <IconButton>
            <HelpOutlineIcon></HelpOutlineIcon>
          </IconButton>
          <IconButton>
            {" "}
            <SettingsIcon></SettingsIcon>
          </IconButton>
          <IconButton>
            <AppsIcon></AppsIcon>
          </IconButton>

          <AccountCircleIcon src="https://lh3.googleusercontent.com/a/AAcHTtfVLNqb0co1vqNombfomHKvcUE9EcJWWM4sUd8NoPWpQWU=s288-c-no"></AccountCircleIcon>
        </div>
      </div>
    </div>
  );
};

export default Header;
